import React, { useState } from 'react';
import { formatDate } from '../../utils/helpers';
import { getRiskCategoryInfo } from '../../utils/helpers';

const PredictionHistory = ({ predictions }) => {
  const [selectedPrediction, setSelectedPrediction] = useState(null);

  if (!predictions || predictions.length === 0) {
    return (
      <div className="text-center py-8">
        <p className="text-gray-500">No prediction history available</p>
      </div>
    );
  }

  return (
    <>
      <div className="overflow-hidden shadow ring-1 ring-black ring-opacity-5 rounded-lg">
        <table className="min-w-full divide-y divide-gray-300">
          <thead className="bg-gray-50">
            <tr>
              <th scope="col" className="px-3 py-3.5 text-left text-sm font-semibold text-gray-900">
                Date
              </th>
              <th scope="col" className="px-3 py-3.5 text-left text-sm font-semibold text-gray-900">
                Risk
              </th>
              <th scope="col" className="px-3 py-3.5 text-left text-sm font-semibold text-gray-900">
                Category
              </th>
              <th scope="col" className="px-3 py-3.5 text-left text-sm font-semibold text-gray-900">
                Details
              </th>
            </tr>
          </thead>
          <tbody className="divide-y divide-gray-200 bg-white">
            {predictions.map((prediction) => {
              const categoryInfo = getRiskCategoryInfo(prediction.risk_category);
              return (
                <tr key={prediction.id} className="hover:bg-gray-50">
                  <td className="whitespace-nowrap px-3 py-4 text-sm text-gray-500">
                    {formatDate(prediction.created_at)}
                  </td>
                  <td className="whitespace-nowrap px-3 py-4 text-sm font-medium text-gray-900">
                    {prediction.risk_percentage}%
                  </td>
                  <td className="whitespace-nowrap px-3 py-4 text-sm">
                    <span
                      className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium ${categoryInfo.bgColor} ${categoryInfo.color}`}
                    >
                      {categoryInfo.label}
                    </span>
                  </td>
                  <td className="whitespace-nowrap px-3 py-4 text-sm text-gray-500">
                    <button
                      className="text-primary-600 hover:text-primary-900"
                      onClick={() => setSelectedPrediction(prediction)}
                    >
                      View Details
                    </button>
                  </td>
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>

      {/* Modal for showing details */}
      {selectedPrediction && (
        <div
          className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center p-4 z-50"
          onClick={() => setSelectedPrediction(null)}
        >
          <div
            className="bg-white rounded-lg shadow-lg p-6 max-w-md w-full"
            onClick={(e) => e.stopPropagation()} // prevent modal close when clicking inside
          >
            <h3 className="text-lg font-semibold mb-4">Prediction Details</h3>
            <p>
              <strong>Date:</strong> {formatDate(selectedPrediction.created_at)}
            </p>
            <p>
              <strong>Risk Percentage:</strong> {selectedPrediction.risk_percentage}%
            </p>
            <p>
              <strong>Risk Category:</strong> {selectedPrediction.risk_category}
            </p>
            {/* Add more fields from prediction object as needed */}
            <button
              onClick={() => setSelectedPrediction(null)}
              className="mt-4 px-4 py-2 bg-primary-600 text-white rounded hover:bg-primary-700"
            >
              Close
            </button>
          </div>
        </div>
      )}
    </>
  );
};

export default PredictionHistory;
